DROP TABLE IF EXISTS `appbox_application`;
CREATE TABLE `appbox_application`  (
  `id` bigint NOT NULL COMMENT 'id',
  `parent_id` bigint NULL DEFAULT NULL COMMENT '上级id',
  `config_id` bigint NULL DEFAULT NULL COMMENT '配置id',
  `classes_id` bigint NULL DEFAULT NULL COMMENT '所属分类id',
  `app_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '名称',
  `icon_url` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '图标',
  `cover` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '应用封面',
  `popularity` int NULL DEFAULT 0 COMMENT '热度',
  `pv` int NULL DEFAULT 0 COMMENT '页面访问量',
  `uv` int NULL DEFAULT 0 COMMENT ' 独立访客数',
  `channel_status` tinyint NULL DEFAULT NULL COMMENT '频道状态:1应用 2频道',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '应用简介',
  `create_by` bigint NULL DEFAULT NULL COMMENT '创建者',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_by` bigint NULL DEFAULT NULL COMMENT '更新者',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `create_dept` bigint NULL DEFAULT NULL COMMENT '创建部门',
  `tenant_id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '000000' COMMENT '租户编号',
  `channel_type` int NULL DEFAULT 2 COMMENT '频道类型: 1官网 2公众',
  `assign` int NULL DEFAULT 99 COMMENT '频道指定内容: 0更新通知 1视频 2官方通知 3反馈收集 4语音 5群聊  6角色 99其他 ',
  `permission` int NULL DEFAULT 3 COMMENT '应用角色:  0创建者 1 管理员 2Ai 用户 3普通成员 ',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '应用表' ROW_FORMAT = DYNAMIC;

